import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
const weekMap= new WeakMap();
const a={};
weekMap.set(a, "Monday");
console.log(weekMap.get(a));
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
